import React, { Component } from 'react';

class AdminUser extends Component {
    constructor(props) {
        super(props);
        this.state = {
            userList: this.props.userList
        }
        this.manageUser = this.manageUser.bind(this);
    }

    manageUser() {
        let { userList } = this.state;
        let showUserList = userList.map((item) => {
            return (
                <tbody key={item.id}>
                        <tr key={item.id + index}>
                            <td key={item.name + index}>
                                {item.name}
                            </td>
                            <td key={item.sur + index}>
                                {item.description}
                            </td>
                            <td key={item.start + index}>
                                {item.start}
                            </td>
                            <td key={item.end + index}>
                                {item.end}
                            </td>
                            <td key={item.location + index}>
                                {item.location}
                            </td>
                        </tr>
                    </tbody>
            );
        })
        return (
            <div>
                <table className="table table-bordered eventtable">
                    <thead>
                        <tr>
                            <th><label>Event Type </label> </th>
                            <th><label>Event Description </label> </th>
                            <th><label>Event Start </label> </th>
                            <th><label>Event End </label> </th>
                            <th><label>Event Location</label> </th>
                        </tr>
                    </thead>
                    {showUserList}
                </table>
            </div>
        );
    }

    render() {

        return (
            <div className="container">
                <div className="row m-4">
                    <button
                        type="submit"
                        className="btn btn-success"
                        onClick={this.manageUser}
                    >Manage User</button>
                </div>
            </div>
        );
    }
}

export default AdminUser;
